import React, { useEffect, useState } from "react";
import { getAllSowings } from "../services/sowingService";

import RegisterSowing from "../components/sowing/RegisterSowing";
import EditSowing from "../components/sowing/EditSowing";
import DeleteSowingModal from "../components/sowing/DeleteSowingModal";
import ViewSowing from "../components/sowing/ViewSowing";

// ICONOS
import searchIcon from "../images/buscar.png";
import addIcon from "../images/agregar.png";
import editIcon from "../images/editar.png";
import deleteIcon from "../images/eliminar.png";
import detailsIcon from "../images/detalles.png";

import "../../styles/SowingPage.css";

export default function SowingPage() {
  const [sowings, setSowings] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");

  const [openRegister, setOpenRegister] = useState(false);
  const [openEdit, setOpenEdit] = useState(null);
  const [openDelete, setOpenDelete] = useState(null);
  const [openView, setOpenView] = useState(null);

  useEffect(() => {
    loadSowings();
  }, []);

  const loadSowings = async () => {
    const res = await getAllSowings();
    setSowings(res.data);
  };

  // FILTRO
  const filtered = sowings.filter(sow =>
    sow.seedName.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="sowing-container">

      {/* Toolbar */}
      <div className="toolbar">

        <div className="search-box">
          <img src={searchIcon} alt="" />
          <input
            type="text"
            placeholder="Buscar siembras..."
            value={searchTerm}
            onChange={e => setSearchTerm(e.target.value)}
          />
        </div>

        <div className="toolbar-actions">
          <button className="icon-btn" onClick={() => setOpenRegister(true)}>
            <img src={addIcon} alt="" />
          </button>
        </div>
      </div>

      {/* LISTA */}
      <div className="sowing-list">
        {filtered.map((sowing, i) => (
          <div key={sowing.id} className="sowing-item">

            <div className="item-info">
              <img
                src={i % 2 === 0 ? "/plant1.png" : "/plant2.png"}
                className="item-icon"
                alt=""
              />
              <span>
                {sowing.seedName} â€” {sowing.status}
              </span>
            </div>

            <div className="item-actions">
              <button onClick={() => setOpenView(sowing.id)}>
                <img src={detailsIcon} alt="ver" />
              </button>
              <button onClick={() => setOpenEdit(sowing.id)}>
                <img src={editIcon} alt="editar" />
              </button>
              <button onClick={() => setOpenDelete(sowing.id)}>
                <img src={deleteIcon} alt="eliminar" />
              </button>
            </div>
          </div>
        ))}
      </div>

      {/* MODALES */}
      {openRegister && (
        <RegisterSowing
          onClose={() => setOpenRegister(false)}
          onSaved={loadSowings}
        />
      )}

      {openEdit && (
        <EditSowing
          sowingId={openEdit}
          onClose={() => setOpenEdit(null)}
          onUpdated={loadSowings}
        />
      )}

      {openDelete && (
        <DeleteSowingModal
          sowingId={openDelete}
          onClose={() => setOpenDelete(null)}
          onDeleted={loadSowings}
        />
      )}

      {openView && (
        <ViewSowing
          sowing={sowings.find(s => s.id === openView)}
          onClose={() => setOpenView(null)}
        />
      )}

    </div>
  );
}
